import { useState } from 'react';
import './home.css'
function Home() {
    const[count ,setCount]=useState
    return (
        <>
            <h1>Homepage</h1>
            <h4>counter value <span>100</span></h4>
            <div id='button'>
                <button>Increment</button>
            </div>
        </>
    );
}
export default Home;
